import React, { Component } from "react";

export class SearchForm extends Component {
  render() {
    return (
      <div className="field has-addons">
        <div className="control">
          <input
            className="input"
            type="text"
            placeholder="Busca tu pelicula"
          />
        </div>
      </div>
    );
  }
}

export default SearchForm;
